function App() {
  return (
    <main className="magazineCover">
        P

        <figure>
          <img id="fotoBritney" src={fotoBritney} alt="britney photo" srcset=""/>
        </figure>
        
       
        <section aria-label="magazine cover content" className="content">
          <Left/>
          <Right/>
          <Below/>
          <Finish/>
      </section>
    </main>
  );
}

export default App;
